import{_ as n,X as a,Y as r,a1 as t,Z as e,$ as s,a0 as p}from"./framework-68dd73a2.js";const i={},o=e("h1",{id:"_175-java习题-二-md",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#_175-java习题-二-md","aria-hidden":"true"},"#"),s(" 175-Java习题(二).md")],-1),h=e("div",{class:"hint-container warning"},[e("p",{class:"hint-container-title"},"注意"),e("p",null,"本博文仅供学术研究和交流参考，严禁将其用于商业用途。如因违规使用产生的任何法律问题，使用者需自行负责。")],-1),d=p('<h4 id="热身题" tabindex="-1"><a class="header-anchor" href="#热身题" aria-hidden="true">#</a> 热身题</h4><p>一、请列出您成长至今受益最深的三个网站/APP、三本书、三部电影；</p><p>二、您用哪个IDE写代码？排除掉Ctrl-C、Ctrl-V、Ctrl-Z这三个地球人都知道的，您最常用的三个快捷键是什么？</p><p>三、下面列出了一些人或名词，请解释您所知道的： ·银弹 ·Martin Fowler ·好莱坞原则 ·长尾 ·摩尔定律 ·墨菲法则 ·ABC ·蝴蝶效应</p><h4 id="问答题" tabindex="-1"><a class="header-anchor" href="#问答题" aria-hidden="true">#</a> 问答题</h4><p>四、Java程序的编译和运行过程是如何进行的？Tomcat是如何运行的？</p><p>五、从浏览器输入某网址（如htp:/www.trs.com.cn/），到该网页显示完成，都发生了什么，有哪些处理过程？请试着表达阐述，可图文表述，越清晰越好。</p><p>六、请说明web开发中forward()和redirect()的流程，以及二者的区别、优缺点：</p><p>七、数据库的索引是什么？有什么作用？有什么优缺点？</p><p>八、您熟悉哪些数据库？根据您的实际使用，您认为它们各自有什么优缺点？另外，请您给出它们各自的分页查询的SQL语句；</p><p>九、列举两到三个您在实际工作中印象最深的坑，说明您是怎么解决的。</p><h4 id="综合题" tabindex="-1"><a class="header-anchor" href="#综合题" aria-hidden="true">#</a> 综合题</h4><p>十、假设您接手了一个线上系统，运行环境是Linux+Nginx+Tomcat+MySQL，客户反馈该系统慢，经常要等待，您会怎么去解决该问题？请简要说明您的排查思路、用到的工具、先后次序，以及其他您认为有必要说明的内容。</p><p>十一、将上题换个条件：该系统经常宕机，您会怎么去解决？</p><h4 id="编程题" tabindex="-1"><a class="header-anchor" href="#编程题" aria-hidden="true">#</a> 编程题</h4><p>十二、写出友好显示当前时间的代码。您能写出几种方法？各自优缺点是什么？</p><p>十三、请您实现一个函数isIP（String str），判断传入的字符串是否是个IP地址，并给出单元测试代码（JUnit或TestNG均可，但测试用例要周全）。</p><p>十四、试解答下面的英文题目，并给出单元测试代码：</p><p><strong>Problen statement for PersistentNumber</strong></p><p>Given a number x,we can define p(x)as the product of the digits of x.We can then form a sequence x.p(x).p(p(x)).. The persistence of x is then defined as the index (O-based) of the first single digit number in the sequence. For example, using 99, we get the sequence 99,9<em>9=81,8</em>1=8. Thus, the persistence of 99 is 2. You will be given n, and you must return its persistence.</p><p><strong>Definition</strong></p><p>Class:PersistentNumber</p><p>Method:getPersistence</p><p>Parameters:int</p><p>Returns:int</p><p>Method signature:int getPersistence(int n)</p><p>(be sure your method is public)</p><p><strong>Constraints</strong></p><p>-n will be between 0 and 2,000,000,000, inclusive.</p><p><strong>Examples</strong></p><p>0) 99</p><p>Returns:2</p><p>The example from the problem statement.</p><p>1) 268</p><p>Returns:4</p><p>The sequence here is 268,96,54,20,0.</p><p>2) 6</p><p>Returns:0</p><p>6 is already a single-digit number.</p><p>3) 68889789</p><p>Returns:3</p><p>4) 86898</p><p>Returns:7</p><p><strong>以上就是我关于 <em>Java习题(二)</em> 知识点整理与总结的全部内容，希望对你有帮助。。。。。。。</strong></p><hr><h3 id="分割线" tabindex="-1"><a class="header-anchor" href="#分割线" aria-hidden="true">#</a> 分割线</h3><hr><p><strong>博主为咯学编程：父母不同意学编程，现已断绝关系;恋人不同意学编程，现已分手;亲戚不同意学编程，现已断绝来往;老板不同意学编程,现已失业三十年。。。。。。如果此博文有帮到你欢迎打赏，金额不限。。。</strong></p>',48);function c(u,l){return a(),r("div",null,[t(" more "),o,h,t(" 拓尔思"),d])}const f=n(i,[["render",c],["__file","java175.html.vue"]]);export{f as default};
